import React, { useEffect, useState } from 'react';
import './App.css';
import Die from './Die';

const App = () => {

  const [count, setCount] = useState([]);

  useEffect(() => {
    const Array = [];
    for (let i = 0; i < 10; i++) {
      const obj = { id: i }
      Array.push(obj)
    }
    setCount(Array);
  }, []);

  return (
    <main>
      <h1>Tenzies</h1>
      <p>Roll until all dice are the same. Click each die to freeze it at its current value between rolls.</p>
      <div>
        {count}
      </div>
    </main>
  );
}

export default App;
